import './App.css';
import Myheader from "./components/first_sec";
import Slider from "./components/slider";
import Footer from "./components/footer"; 
import Products from "./components/product";
import Maincard from './components/card';

const menuData = [
  {id:1, name:'About', link: '/about'},
  {id:2, name:'Contact', link: '/product'},
  {id:3, name:'Blog', link: '/blog'}
];


function App() {
  return (
    <div>
      <Myheader menu="Home" items={menuData} />



      <Slider></Slider>
      <Products></Products>
      <Maincard></Maincard>
      <Footer></Footer>


    </div>
  );
}



export default App;
